import React from 'react';

function Navbar() {
    return (
        <div>
            <nav className="navbar navbar-light bg-primary-subtle">
                <div className="container">
                    <span className="navbar-brand mb-0 h1 text-primary">Buscaminas</span>
                </div>
            </nav>
        </div>
    );
}

export default Navbar;
